import React from "react";
import { Link } from "react-router-dom";
const EVENTS = [
  { id: "e1", title: "some event" },
  { id: "e2", title: "more event" },
];

function Events() {
  return (
    <>
      <h1>Events</h1>
      {EVENTS.map((e) => <li key={e.id}>  </li>)}
    </>
  );
}

export default Events;
